import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "./App.scss";

function App() {
  <Router>
    return (
    <div className="app">
      <h1>Basic router system</h1>
    </div>
    );
  </Router>;
}

function Home() {
  return <h2>Home component</h2>;
}

function Contact() {
  return <h2>Contact component</h2>;
}

function Users() {
  return <h2>Users component</h2>;
}
export default App;
